import React from "react";
import "./ControlPins.css";

class ReadValue extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <input type="text" className="read-box" value="val" />
      </div>
    );
  }
}
export default ReadValue;
